import classes from "./Header.module.css";
import { useDispatch } from "react-redux";
import { Routes, Route, useNavigate } from "react-router-dom";
import { formActions } from "../../../store/form-slice";
import Create from "../CreateTask/Create";
import LandingPage from "../LandingPage/LandingPage";

const Header = (props) => {
  const dispatch = useDispatch();
  const checkType = localStorage.getItem("admin");

  const navigate = useNavigate();
  const logoutHandler = () => {
    dispatch(formActions.logout());
  };

  const navigateToCreateTask = () => {
    navigate("/createTask");
  };

  return (
    <header className={classes.header}>
      <h1>Profile</h1>
      <nav>
        <ul>
          {checkType && (
            <li>
              <a href="/" onClick={navigateToCreateTask}>
                Create Task
              </a>
            </li>
          )}
          <li>
            <a href="/">Task Lists</a>
          </li>
          <Routes>
            <Route path="/taskLists" element={<LandingPage />}></Route>
            <Route path="/createTask" element={<Create />}></Route>
          </Routes>
          <li>
            <button onClick={logoutHandler}>Logout</button>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
